import React from 'react';
import ReactDOM from 'react-dom';
import './CoinPair.css';


class CoinPair extends React.Component{
  constructor(props){
  super(props);
  }
  render(){
    const SelectCoins = []
    for (var i=0; i < this.props.data.length; i++) {
      SelectCoins.push(<option value={this.props.data[i]["symbol"]}>{this.props.data[i]["symbol"]}</option>)
    }
    console.log(round(0.0194));
    return(
      <div>
        <div class="form-group">
            <label for="sel1">Select list:</label>
            <select class="form-control" name="CoinPair">
            {SelectCoins}
          </select>
        </div>
      </div>
      )
  }
}
export default CoinPair
